import React, { useState } from "react";
const Search = () => {
    const a = 'Search'
  const [img, setImg] = useState('');
  const inputEvent = (event) => {
    const data = event.target.value;
    console.log(data);
    setImg(data);
  };
  return (
    <>
    <h1>{a}</h1>
      <input
        type="text"
        placeholder="Search Anything"
        value={img}
        onChange={inputEvent}
      />
    </>
  );
};
export default Search;
